import React from 'react'
import { useEffect } from 'react'

const Cart = () => {

    useEffect(() => {
        const name = ['mike', 'jim', 'ryan']
    })

    return (
        <div>
            {name.length > 2 && 
                <h1 className="hello">Hello</h1>
            }
        </div>
    )
}

export default Cart
